    "Group.html": {
      "id": "Group.html",
      "kind": "class",
      "title": "GroupGroup",
      "longname": "Group",
      "name": "Group",
      "tags": "Group",
      "summary": "",
      "description": "Finite extension of the integral Heisenberg group The group is given by the presentation G = &lt; A, B, C | C^k = [A,B], [A,C] = [B, C] = 1 &gt; If H stands for the usual integral Heisenberg group, then G/H is a cyclic group of order k We represents elements using Malc'ev coordinates. The triple [a,b,c] is associated to to the group element C^c B^b A^a With this representation, the group law becomes [a1, b1, c1] * [a2, b2, c2] = [a1 + a2, b1 + b2, c1 + c2 + k a1 * b2] Another point of view is the following. The triple [a,b,c] is represented by the upper triangular matrix [1, a * sqrt(k), c] [0, 1, b * sqrt(k)] [0, 0, 1] The group law is now given by matrix multiplication",
      "body": ""
    },
