    "Position.html#flowFromOrigin": {
      "id": "Position.html#flowFromOrigin",
      "kind": "function",
      "title": "&lt;abstract&gt; flowFromOrigin( v ) → {Position}",
      "longname": "Position#flowFromOrigin",
      "name": "flowFromOrigin",
      "tags": "Position#flowFromOrigin flowFromOrigin",
      "summary": "",
      "description": "Replace the current position, by the one obtained by flow the initial position (id, id) in the direction v (given in the reference frame)."
    },
    "Position.html#flow": {
      "id": "Position.html#flow",
      "kind": "function",
      "title": "flow( v ) → {Position}",
      "longname": "Position#flow",
      "name": "flow",
      "tags": "Position#flow flow",
      "summary": "",
      "description": "Flow the current position. v is the pull back at the origin by the position of the direction in which we flow The time by which we flow is the norm of v. The procedure goes as follows. Let e = (e1, e2, e3) be the reference frame in the tangent space at the origin. Assume that the current position is (g,m) The vector v = (v1, v2, v3) is given in the observer frame, that is v = d_og m u, where u = u1 . e1 + u2 . e2 + u3 . e3. We first pull back the data at the origin by the inverse of g. We compute the position (g',m') obtained from the initial position (id, id) by flowing in the direction w = m u. This position send the frame m e to d_o g' . m ' . m . e We move everything back using g, so that the new observer frame is d_o (gg') . m' . m e. Hence the new position (gg', m'm) is obtained by multiplying (g,m) and (g',m')"
    },
    "Position.html#fakeDiffExpMap": {
      "id": "Position.html#fakeDiffExpMap",
      "kind": "function",
      "title": "fakeDiffExpMap( matrix ) → {Position}",
      "longname": "Position#fakeDiffExpMap",
      "name": "fakeDiffExpMap",
      "tags": "Position#fakeDiffExpMap fakeDiffExpMap",
      "summary": "",
      "description": "Fake version of the differential of the exponential map. Assume that the current position is the (Id,Id). Take as input a Matrix4 matrix seen as an affine isometry of R^3 = T_oX with respect to the reference frame e = (e_1, e_2, e_3) (or more precisely, an isometry of the tangent bundle of T_oX) Update the position with the following properties. Let u = matrix . (0,0,0,1) that is the image of the origin of T_oX by matrix Let v = matrix . (0,0,1,0) that is the image of the vector e_3 by matrix The updated position (g,m) is such that g . origin = exp(u) and d_og m v = d_u exp v Or at least, this is the ideal goal. We fake the behavior using parallel transport. Apparently the error made if of the order of O(|u|^2). https://mathoverflow.net/questions/126104/difference-between-parallel-transport-and-derivative-of-the-exponential-map Thus for controllers supposed to stay close to the user, it could be enough. (The overlay of the controllers and the seen is only correct at the first order.) If the current position is not (Id, Id), then everything is made \"relative\" to the current position."
    },
