      "longname": "RelPosition",
      "name": "RelPosition",
      "tags": "RelPosition",
      "summary": "",
      "description": "Relative position. A general position is represented as a pair (h,p) where h (cellBoost) is an GroupElement representing an element of a discrete subgroups p (local) is a Position The frame represented by the relative position is the image by h of the frame represented by the position p We split the isometry part (hg) in two pieces. The idea is to g should gives a position in the fundamental domain of the (implicit) underlying lattice. This will keep the coordinates of g in a bounded range. For simplicity we also keep track of the inverse of the cellBoost.",
